//Save material as json from js to program and send with modeldata


var scene = new THREE.Scene();

var renderer = new THREE.WebGLRenderer({ alpha: true });
renderer.setClearColor(0x000000, 0);
var camera = new THREE.PerspectiveCamera();
camera.position.z = 4;
camera.lookAt(0, 0, 0);

var light = new THREE.DirectionalLight();
light.shadow.camera.left = -20;
light.shadow.camera.right = 20;
light.shadow.camera.top = 20;
light.shadow.camera.bottom = -20;

var ambient = new THREE.AmbientLight();
ambient.intensity = 0.3;
light.intensity = 0.7;

var controls;

var blankTexture = {
    mapBlack: "data:image/jpeg;base64,",
    mapWhite: "data:image/jpeg;base64,",
    normalMap: "data:image/jpeg;base64,",

}

var sphere = new THREE.Mesh(new THREE.SphereGeometry(1, 32, 32), new THREE.MeshStandardMaterial());
var material = sphere.material;


var models = [];
var currentModel;

scene.add(sphere, light, ambient, camera);

function loadModel(json, materials) {
    
    debugger;
    var obj = JSON.parse(json);
    var info = new THREE.JSONLoader().parse(obj);
    var mesh = new THREE.Mesh(info.geometry, info.materials);
    scene.add(mesh);
    models.push(mesh);

    switchModel(models.length - 1);

    setMaterial(materials);
}

function setLightRotation(float) {
    sunSpeed = float;
    var d = sunSpeed / 180;
    var rad = d * Math.PI;
    light.position.set(Math.cos(rad), 0, Math.sin(rad));
}

function switchModel(id) {

    if (currentModel) {
        currentModel.visible = false;
    }

    currentModel = models[id];

    currentModel.visible = true;



}

function setRoughness(float) {
    material.roughness = float;
}

function setMetalness(float) {
    material.metalness = float;
}

function setDisplacement(float) {
    material.displacementScale = float;
}

function setTiling(x, y) {
     
    var maps = [material.map, material.normalMap, material.metalnessMap, material.roughnessMap, material.displacementMap];

    for (var m = 0; m < maps.length; m++) {

        if (maps[m]) {
            maps[m].repeat.set(x, y);
        }
    }

}

function setNormalScale(x, y) {
    material.normalScale.set(x, y);
}

function setMaterial(cmaterial) {

    cmaterial = JSON.parse(cmaterial);


    //If cmaterial is not an array, create an array of materials
    cmaterial = !cmaterial.length ? [cmaterial] : cmaterial;
    var materials = [];


    for (var i = 0; i < cmaterial.length; i++) {
        var mat = new THREE.MeshStandardMaterial();

        var currentMat = cmaterial[i];

        for (var propertyName in currentMat) {

            //Is a map
            if (propertyName.toLowerCase().indexOf("map") > -1) {

                if (currentMat[propertyName] && currentMat[propertyName].length > 1) {
                    setTexture(currentMat[propertyName], propertyName, currentMat.tiling[0] || 1, currentMat.tiling[1] || 1, mat);
                }

            }
            else {

                if (propertyName == "normalScale") {

                    var val = cmaterial[propertyName];
                    mat[propertyName] = new THREE.Vector2(val, val);
                }
                else if (propertyName == "tiling") {

                    var val = currentMat[propertyName];
                    setTiling(val[0], val[1]);
                }
                else if (propertyName == "color") {
                    mat.color = new THREE.Vector3(currentMat.color[0], currentMat.color[1], currentMat.color[2]);
                }
                else {
                    mat[propertyName] = currentMat[propertyName];
                }
            }
        }

        materials.push(mat);
    }

    currentModel.material = materials;
}

function selectMaterial(id) {

    material = currentModel.material[id];
}

function updateMaterial(names) {

    var obj = JSON.parse(names);

    for (var i = 0; i < obj.length; i++) {

        if (obj[i].name == "tiling") {
            setTiling(obj[i].value[0], obj[i].value[1]);
        }
        else if (obj[i].name == "normalScale") {
            var v = obj[i].value;
            material.normalScale = new THREE.Vector2(v, v);
        }
        else {
            material[obj[i].name] = obj[i].value;
        }
    }
}

function setTiling(x, y) {

    var maps = [material.map, material.normalMap, material.roughnessMap, material.displacementMap];

    for (var m = 0; m < maps.length; m++) {

        if (maps[m]) {
            maps[m].repeat.set(x, y)
        }
    }

    material.needsUpdate = true;

}

function setColor4(c, type) {
    c = JSON.parse(c);
    console.log(c);
    material[type] = new THREE.Vector3(c[0], c[1], c[2]);

}

function setTexture(base64, type, x, y, mat) {

    mat = mat || material;

    var img = 'data:image/png;base64,' + base64;
    mat[type] = new THREE.TextureLoader().load(img);
    mat[type].repeat.set(x, y);
    mat[type].wrapS = mat[type].wrapT = THREE.RepeatWrapping;
    mat.needsUpdate = true;

}

var sunSpeed = -1;

function render() {

    if (sunSpeed == -1) {
        var p = performance.now() / 2000;
        light.position.set(Math.cos(p), 0, Math.sin(p));
    }

    renderer.render(scene, camera);
    requestAnimationFrame(render);
}

function run(elem) {

    console.log("running...")
    renderer.setSize(elem.clientWidth, elem.clientHeight);

    elem.appendChild(renderer.domElement);
    render();
}

window.onload = function () {

    var divs = $(".wrapper");

    $(divs).click(function (event) {

        if ($(event.target).hasClass("model")) {

            if (!currentModel) {
                return;
            }
            currentModel.visible = true;
            sphere.visible = false;
        }

        $(divs).each(function () {

            $(this).removeClass("selected");
        })

        $(event.target).addClass("selected");

        if ($(event.target).hasClass("sphere")) {
            currentModel.visible = false;
            sphere.visible = true;
        }

    })

    controls = new THREE.OrbitControls(camera, $(".renderview")[0]);

    run(document.getElementById("render-view"));
}